import styled from "styled-components";

export const Container = styled.div`
  .Navbar {
    display: flex;
    justify-content: space-between;
    align-content: center;
    align-items: center;
    justify-items: center;
    width: 100%;
  }

  .alerts {
    color: white;
    background-color: #b9060d;
    width: fit-content;
    padding: 0.3rem 0.5rem;
    border-radius: 50%;
  }
`;
